import React from "react";

const styles = {
    //creo un objeto
    width: 120,
    heght: 32,
    backgroundColor: "blue",
};

const ButtonCustom = (props) => {
    return (
        <div>
            <button style={styles}>{props.label}</button>
        </div>
    );
};

export default ButtonCustom;
